import React, {useState} from "react";
import "./Signup.css";

const formValues = {username : "", password : ""}
function Login(){
    const [username, changeName] = useState();
    const [password, changePassword] = useState();
    const [confirmPassword, changeConfirm] = useState();
    
    const handleSubmit = (e) =>{
        e.preventDefault();
        formValues.username = username;
        // if(password === confirmPassword){
        //     formValues.password = password;
        // }
        // else{
        //     alert("Password does not match :( Please Try Again")
        //     changePassword("");
        //     changeConfirm("");
        // }
        formValues.password = password;
        console.log(formValues)
    }
    return (
        <main className="form-signin">
         {/* SignIn Page */}
  <form onSubmit={()=>{return false;}}>
    <div className="dice-header">
    <svg xmlns="http://www.w3.org/2000/svg" width="56" height="56" fill="#5865F2" className="bi bi-dice-5 logo" viewBox="0 0 16 16">
        <path d="M13 1a2 2 0 0 1 2 2v10a2 2 0 0 1-2 2H3a2 2 0 0 1-2-2V3a2 2 0 0 1 2-2h10zM3 0a3 3 0 0 0-3 3v10a3 3 0 0 0 3 3h10a3 3 0 0 0 3-3V3a3 3 0 0 0-3-3H3z"/>
        <path d="M5.5 4a1.5 1.5 0 1 1-3 0 1.5 1.5 0 0 1 3 0zm8 0a1.5 1.5 0 1 1-3 0 1.5 1.5 0 0 1 3 0zm0 8a1.5 1.5 0 1 1-3 0 1.5 1.5 0 0 1 3 0zm-8 0a1.5 1.5 0 1 1-3 0 1.5 1.5 0 0 1 3 0zm4-4a1.5 1.5 0 1 1-3 0 1.5 1.5 0 0 1 3 0z"/>
    </svg>
    </div>
    <h1 className="h3 mb-3 fw-normal discord-purple">Login</h1>

    <div className="input-container">
        <div className="form-floating">
            <input type="email" className="form-control" id="floatingInput" placeholder="name@example.com" onChange={(e)=>{changeName(e.target.value)}}/>
            <label for="floatingInput">Username</label>
        </div>
        <div className="form-floating">
            <input type="password" className="form-control radius-add" id="floatingPassword" placeholder="Password" onChange={(e)=>{changePassword(e.target.value)}}/>
            <label for="floatingPassword">Password</label>
        </div>
        <div className="form-floating">
            <input type="password" className="form-control radius-control" id="floatingPassword" placeholder="Password" onChange={(e)=>{changeConfirm(e.target.value)}}/>
            <label for="floatingPassword">Confirm Password</label>
        </div>
    </div>

    <button className="w-100 btn btn-lg discord-background-purple" type="submit" onSubmit={handleSubmit}>Login</button>
    <p className="mt-5 mb-3 discord-purple">&copy; 2021-present</p>
  </form>
</main>
    )
}

export {formValues};
export default Login;
